import FormGroup from "react-bootstrap/esm/FormGroup"
import { Form } from "react-router-dom"

function CreateNewSpecial(){
    return (
        <Form>
            <Form.Group>
                <Form.Label>Location Name</Form.Label>
                <Form.Control />
            </Form.Group>
        </Form>
    )
}

export default CreateNewSpecial
